import "./PlatformHeader.scss";
import React from "react";

export class PlatformHeader extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <header className="platform-header-wrapper">
          <div className="header-logo-icon"></div>

        <nav className="header-nav">
          <div className="header-nav-interview">
            <a href="/hiring/compare/" className="header-link">
              <div className="interview-icon header-icon"></div>
              Опрос
            </a>
          </div>
          <div className="header-nav-staff">
            <a href="/#" className="header-link">
              <div className="staff-icon header-icon"></div>
              Персонал
            </a>
          </div>
          <div className="header-nav-methodology">
            <a href="/#" className="header-link">
              <div className="methodology-icon header-icon"></div>
              Методологии
            </a>
          </div>
        </nav>
        <div className="profile">
          <div className="profile-name">Пастернак А.А.</div>
          <div className="profile-photo"></div>
        </div>
      </header>
    );
  }
}
